import React from 'react';
import { BarChart, Bar,ResponsiveContainer, XAxis, Tooltip} from 'recharts';

const SkillCharts = () => {
    const data = [
        {
          name: 'React', Skills: 3,
        },
        {
          name: 'JavaScript', Skills: 3,
        },
        {
          name: 'CSS', Skills: 4,
        },
        {
          name: 'HTML', Skills: 4,
        },
        {
          name: 'PHP', Skills: 2,
        },
      ];

    return(
        <ResponsiveContainer>
            <BarChart data={data}>
                <XAxis dataKey="name" />

                <Tooltip />
                <Bar dataKey="Skills" fill="#8884d8" />
            </BarChart>
        </ResponsiveContainer>
    );
}

export default SkillCharts;
